import React, { Component } from "react";
import FrameExample from "./components/Header.js";
import { Page } from "@shopify/polaris";
import "@shopify/polaris/styles.css";

import "./App.css";
import { AppProvider } from "@shopify/polaris";

function App() {
  return (
    <div className="frame">
      <AppProvider>
        <FrameExample />
        <Page />
      </AppProvider>
    </div>
  );
}

export default App;
